import React from 'react';
import './App.css';



const App = () => {
  return (
    <div>
			<header>
				<img src = 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSjFMReJvcQ0Z1pD2h1FXmwqJT8BSii9W8FlQ&usqp=CAU' />
			</header>
			<nav>
				<div>Profile</div>
				<div>Messeges</div>
			</nav>
    </div>
  );
}



export default App;
